import React, { Component } from "react";
import { Link } from "react-router-dom";
import { Icon } from "semantic-ui-react";
import styled from "@emotion/styled";
import "reset-css";

class Header extends Component {
  constructor(props) {
    super(props);
    this.state = {
      name: "Kostya"
    };
  }
  render() {
    return (
      <div>
        <h1>{this.state}</h1>
      </div>
    );
  }
}

export default Header;
